caption:
تمر الجزائر بأوقات صعبة في المرحلة الراهنة، ومن واجبنا كمواطنين أن نعمل على تحريرها  ومن واجبنا كمواطنين أن نعمل على تحريرها من قيود هذه الأزمة. 
لقد أظهر الشعب الجزائري صموده وأنه لن ينهار أبدََا... لأن قوتنا تكمن في الوحدة والتضامن.

قصد المحافظة على هذه الروح الوطنية، يجب أن نستمر على هذا المنوال ولا ننسى مرضانا المصابين بفيروس كورونا والذين هم بحاجة ماسة إلى لوازم طبية.

لذلك فإننا نطلق نداءً لجمع التبرعات رغبة في مواجهة الموجة الثالثة من وباء كورونا من خلال التواصل مع:
@algeria.united.foundation
@winnelka

L’Algérie passe actuellement par des temps durs et il est de notre devoir en tant que citoyens de faire face à cette crise.

Nous avons démontré que l'esprit algérien ne s'effondre devant rien et que c'est dans l'union et la solidarité que réside notre force. C’est pourquoi il faut continuer sur cette lancée et ne pas oublier les patients atteints par la COVID-19.

Les Clubs de l'ENP @iec.enp, @cap.enp et nous , lançons alors un appel aux dons pour mener à bien cette lutte contre le virus, en contactant :

@algeria.united.foundation
@winnelka

